from typing import List

class Solution:
    def kthDistinct(self, arr: List[str], k: int) -> str:
        d = {}
        number_of_dist = 0
        for i in arr:
            if i not in d:
                d[i] = True
                number_of_dist += 1
            else:
                number_of_dist -= d[i]
                d[i] = False
        if number_of_dist < k:
            return ""

        cur_dist = 0
        for i in d:
            cur_dist += d[i]
            if cur_dist == k: return i

